import React from 'react';
import './Hello.css';

class Hello extends React.Component {
	render(){
		return (
			<div className ="f1 tc">	
				<h1> Hello world </h1>
				<p> {this.props.greeting} </p>
				<p>{this.props.goodbye}</p>
			</div>
		)
	};
};
// function Hello () {
// 	return <h1> Hello world </h1>;
// };

export default Hello;
